import React, { useState } from 'react';
import Ho from './Home.module.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouse } from '@fortawesome/free-solid-svg-icons';

function Home() {
  return (
    <div className={Ho.homain}>
      <div className={Ho.hocont}>
      <div className={Ho.homn}>
         <h1>Logo</h1>
         <p>Dashboard</p>
         <p>Invitations</p>
         <p>Your Activities</p>
         <p>Chat</p>
         <p>Settings</p>
      </div>
      <div className={Ho.horiz}>
         <div className={Ho.horem}>
            <h1>Reminder</h1>
            <p>30 mins to take<br/>your medicine pill </p>
            
         </div>
         <div className={Ho.hotask}>

         </div>
      </div>
      </div>
    </div>
  );
}
export default Home;
